import React from 'react';
import './App.css';

import { Button, Form, FormGroup, Label, Input }
  from 'reactstrap';

import { FacebookSignupButton } from 'react-social-login-buttons';

function App() {
  return (
    <Form className="App">
      <h1>
        This is the <span className="font-weight-bold">signup page</span> for a User (Buyer)
      </h1>
      <h2>Welcome to Authentic Chef </h2>
      <FormGroup>
        <label>Name</label>
        <input type = "name" placeholder = "Full Name" />
      </FormGroup>
    </Form>
  );
}

export default App;
